import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "../interfaces/ISuOracle.sol";

contract MockOracle is ISuOracle, Ownable {
    constructor() {
    }

    mapping (address => uint256) assets;

    function getUsdPrice1e18(address asset) override external view returns (uint) {
        return assets[asset] * 10**18;
    }

    function setPrice(address asset, uint256 price) public onlyOwner {
        assets[asset] = price;
    }
